import Table from "./UI/Table";
import ButtonTableHead from "./UI/ButtonTableHead";
import React from "react";
import PagesList from "./PagesList";

const CreateTable = ({
  userList,
  remove,
  requestSort,
  currentPage,
  setCurrentPage,
  totalPage,
}) => {
  if (!userList.length) {
    return <div style={{ margin: "50px" }}>Nothing found</div>;
  }
  const renderList = userList.map((user) => (
    <tr key={user.id}>
      <td>{user.id}</td>
      <td>{user.name}</td>
      <td>{user.email}</td>
      <td>
        <button style={{ cursor: "pointer" }} onClick={() => remove(user)}>
          del
        </button>
      </td>
    </tr>
  ));

  return (
    <>
      <Table>
        <caption style={{ fontSize: "30px", marginTop: "30px" }}>
          Table of users
        </caption>
        <thead>
          <tr>
            <th>
              <ButtonTableHead onClick={() => requestSort("id")}>
                Number
              </ButtonTableHead>
            </th>
            <th>
              <ButtonTableHead onClick={() => requestSort("name")}>
                Name
              </ButtonTableHead>
            </th>
            <th colSpan={2}>
              <ButtonTableHead onClick={() => requestSort("email")}>
                Email
              </ButtonTableHead>
            </th>
          </tr>
        </thead>
        <tbody>{renderList}</tbody>
      </Table>
      <PagesList
        currentPage={currentPage}
        setCurrentPage={setCurrentPage}
        totalPage={totalPage}
      />
    </>
  );
};

export default CreateTable;
